  subroutine get_ccn_dk_basis(basis_data, element_number, n_zeta, ilast)
    type(basis_set_type), intent(out) :: basis_data
    integer, intent(in) :: element_number, n_zeta
    integer, intent(out) :: ilast
    integer :: basis_type
    integer :: iw
    logical :: maswrk

    basis_type = n_zeta_to_basis(n_zeta)
    maswrk = .true.
    iw = 6
    ilast = 0

    select case (basis_type)

      case (PVDZ)
        call get_ccn_dk_basis_pvdz(basis_data, element_number, ilast)

      case (PVTZ)
        call get_ccn_dk_basis_pvtz(basis_data, element_number, ilast)

      case (PVQZ)
        call get_ccn_dk_basis_pvqz(basis_data, element_number, ilast)

      case (PV5Z)
        call get_ccn_dk_basis_pv5z(basis_data, element_number, ilast)

      case default
        if(maswrk) write(iw,*) 'ERROR: Basis type not supported'
        ilast = -1
        return
    end select

  end subroutine get_ccn_dk_basis

